import React, {useState} from "react";


function DigitalProgramming(){
    const [DigitalProgramming, setDigitalProgramming] = useState({
        VideoList: {
            "C1a1TK_2KPA":{
                category: "YA",
                Tags: "#Halloween"
            }
        }
    });

    function returnDigitalProgrammingData()
    {
        DigitalProgramming.VideoList.array.forEach(element => {
            (
                <h1>element</h1>
            )
        });
    }
    return (
        <div className="DigitalProgramming">
        <h1> DigitalProgramming Page </h1>
        {returnDigitalProgrammingData()}
    </div>
    );
}

export default DigitalProgramming;
